$(() => {
    $('.js-prevent-default').on('click', function (e) {
        e.preventDefault();
    });
});


$(() => {
    //sticky header
    $(window).scroll(function() {
        if ($(this).scrollTop() > 5){
            $('body').addClass('sticky-header');
        } else {
            $('body').removeClass('sticky-header');
        }
    });
});

